import './newsCard.css'
function NewsCard() {
  return (
    <div className='card'> 
    <img src='th.jpg' className='card-img' />
    <div className='card-info'>
     <h3 className='card-title'>Title</h3> 
    </div>
    </div>
  );
}

export default NewsCard;
